int max(int t[], int N) {
    int result = 0;
    
    for (int i = 0; i < N; i++) {
        if (t[i] % 2 == 0) continue;

        int l = i, r;
        int curr = 1;

        for (r = N - 1; r > l; r--) {
            if (t[l] == t[r] && t[l] % 2 == 1) {
                curr = (curr == 1) ? 2 : curr + 2;
                l++;
            }
            else {
                curr = 1;
                l = i;
            }
        }

        if (r == l && l > i) curr += 1;

        if (curr > result) result = curr;
    }
    return result;
}


int podciag(int tab[], int N){
	int best = 0;
	int originalStart_i = 0;
	int currLong = 0;
	int right = 0;
	int left = 0;

	for(int i = 0; i < N; i++){
		if(tab[i] % 2 == 0) continue;

		//cout << i << ") new interation: " << tab[i] << endl;
		currLong = 0;

		for(int k = N-1; k >= i; k--){
			if(tab[k] % 2 == 0) continue;

			//cout << "checking from end: " << tab[k] << " and " << tab[i] << endl;
			currLong = k - i + 1; //dlugosc tego podciagu gdyby okazal sie spojny
			right = k; //last element
			left = i;
			bool spojny = true;
			while(left < right){
				if(tab[right] % 2 == 0 && tab[left] % 2 == 0){ //mial byc zlozonby tylko z nparzystych
					spojny = false;
					break;
				}
				if(tab[left] != tab[right]){ //nie bedzie spojny jak sie roznia
					//cout << "nie spojny: " << tab[right] << " and " << tab[left] << endl;
					spojny = false;
					break;
				}

				//cout << "inside while: " << tab[right] << " and " << tab[left] << endl;
				left++;
				right--;
			}
			if(spojny){ //jest spojny podciąg!!!!!\n
				//cout << "jest spojny\n";
				if(currLong > best){
					//cout << "new best: " << currLong << endl;
					best = currLong;
				}
			}
			//cout << "end" << endl;
			currLong = 0;
		}

		//cout << endl;

	}

	return best;
}
